import React from 'react';
import './';

import logoEA from './rtacademy/src/images/telkomuniverseity.png';
import logoDeloitte from './rtacademy/src/images/ITB.jpg';
import logoToyota from './rtacademy/src/images/SMKTMKS.png';
import logoIntel from './images/banner-logo-intel.svg';

function LogoCarousel() {
  const logos = [
    { src: logoEA, alt: 'EA Sports' },
    { src: logoDeloitte, alt: 'Deloitte' },
    { src: logoToyota, alt: 'Toyota' },
    { src: logoIntel, alt: 'Intel' },
  ];

  const logoItems = [...logos, ...logos];

  return (
    <div className="logo-carousel">
      <div className="logo-track">
        {logoItems.map((logo, index) => (
          <div className="logo-item" key={index}>
            <img src={logo.src} alt={logo.alt} />
          </div>
        ))}
      </div>
    </div>
  );
}

export default LogoCarousel;
